import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css'

function Home(){
    return(
        <div className="container-fluid Home">
            <div className="row searchbar"></div>
            <div className="row">
                <div className="col-2 sidebar"></div>
                <div className="col-10 main"></div>
            </div>
        </div>
    )
}
export default Home;
